import React from 'react';
import ReactRouter, { Switch, Route, Link, BrowserRouter as Router} from 'react-router-dom';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <Router>
      <div>
        <nav>
          <ul>
            <li>
              <Link to='/'>Home</Link>
            </li>
            <li>
              <Link to='/about'>About</Link>
            </li>
            <li>
              <Link to='/blog'>Blog</Link>
            </li>
          </ul>
        </nav>
        <Switch>
          <Route path="/about">
            <About/> 
          </Route>
        </Switch>
      </div>
    </Router>


  );
}

export default App;
